Copper Cane Wines es la bodega de Joseph Wagner. 5ta Generación de enólogos de una de las familias productoras más importantes Del Valle de Napa. Sus abuelos y padres fundaron la famosa Caymus Vineyards. En Argentina 🇦🇷 estamos felices de poder representar los vinos de Copper Cane. Contamos con 6 extraordinarios vinos: Quilt Chardonnay de Carneros y Oak knoll. Elouan Pinot Noir de Oregon. Böen Pinot Noir de Russian River, Belle Glos Pinot Noir de Santa María Valley, Beran Zinfandel Napa Valley y Quilt Cabernet Sauvignon un tremendo blend de regiones Del Valle de Napa. Copper Cane es la única bodega Norteamericana con un pie en Argentina 🇦🇷. Contamos con stock de sus vinos. 
Ingresa a www.internationalwinemore.com/shop y hacemos tu pedido.

